// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/token/ERC20/SafeERC20.sol';

import './interfaces/IOracle.sol';
import './interfaces/IBoardroom.sol';
import './interfaces/IERC20Burnable.sol';
import './interfaces/ISimpleERCFund.sol';
import './libraries/Math.sol';
import './libraries/FixedPoint.sol';
import './libraries/Epoch.sol';
import './libraries/Safe112.sol';
import './libraries/AdminRole.sol';
import './libraries/ContractGuard.sol';

/**
 * @title GoSwap Cash Treasury合约
 * 实现功能：
 * 1.通过预言机获取GOC价格，根据GOC价格不同，用GOC购买GOB，或赎回GOB获得GOC
 * 2.根据GOC价格不同，增发GOC，并把新增发的GOC分配给fund treasury boardroom
 * 注解：TimBear 20210107
 * @notice Monetary policy logic to adjust supplies of basis cash assets
 * @author Summer Smith & Rick Sanchez
 */
contract Treasury is ContractGuard, Epoch {
    using FixedPoint for *;
    using SafeERC20 for IERC20;
    using Address for address;
    using SafeMath for uint256;
    using Safe112 for uint112;

    /* ========== STATE VARIABLES ========== */

    // ========== FLAGS 标记
    /// @notice 已迁移
    bool public migrated = false;
    /// @notice 已初始化
    bool public initialized = false;

    // ========== CORE 核心
    /// @notice 开发者基金
    address public fund;
    /// @notice GoSwap Cash地址
    address public cash;
    /// @notice GoSwap Bond地址
    address public bond;
    /// @notice GoSwap Token地址
    address public share;
    /// @notice 董事会合约地址
    address public boardroom;

    /// @notice Bond预言机地址
    address public bondOracle;
    /// @notice 铸币税预言机
    address public seigniorageOracle;

    // ========== PARAMS 参数
    /// @notice 基准价格
    uint256 public cashPriceOne;
    /// @notice 价格天花板
    uint256 public cashPriceCeiling;
    /// @notice Bond亏空底线
    uint256 public bondDepletionFloor;
    /// @dev 累计铸币税
    uint256 private accumulatedSeigniorage = 0;
    /// @notice 开发者基金分配比例 2%
    uint256 public fundAllocationRate = 2; // %

    /* ========== CONSTRUCTOR ========== */
    /**
     * @dev 构造函数
     * @param _cash GoSwap Cash地址
     * @param _bond GoSwap Bond地址
     * @param _share GoSwap Token地址
     * @param _bondOracle Bond预言机地址
     * @param _seigniorageOracle 铸币税预言机
     * @param _boardroom 董事会合约地址
     * @param _fund 开发者基金
     * @param _startTime 开始时间
     */
    constructor(
        address _cash,
        address _bond,
        address _share,
        address _bondOracle,
        address _seigniorageOracle,
        address _boardroom,
        address _fund,
        uint256 _startTime
    ) public Epoch(1 days, _startTime, 0) {
        cash = _cash;
        bond = _bond;
        share = _share;
        bondOracle = _bondOracle;
        seigniorageOracle = _seigniorageOracle;

        boardroom = _boardroom;
        fund = _fund;

        // 基准价格为1
        cashPriceOne = 10**18;
        // cash价格天花板为1.05 105 * 10**18 / 10**2 = 1.05 ether
        cashPriceCeiling = uint256(105).mul(cashPriceOne).div(10**2);
        // band亏损下限 1000 * 10**18
        bondDepletionFloor = uint256(1000).mul(cashPriceOne);
    }

    /* =================== Modifier =================== */

    /// @notice 修饰符：需要完成Migration，即完成更换Admin为本合约
    modifier checkMigration {
        require(!migrated, 'Treasury: migrated');
        _;
    }

    /// @notice 修饰符：合约cash bond share boardroom的Admin必须为本合约
    modifier checkAdmin {
        require(
            AdminRole(cash).isAdmin(address(this)) &&
                AdminRole(bond).isAdmin(address(this)) &&
                AdminRole(share).isAdmin(address(this)) &&
                AdminRole(boardroom).isAdmin(address(this)),
            'Treasury: need more permission'
        );
        _;
    }

    /* ========== VIEW FUNCTIONS ========== */
    //一些只读方法

    /**
     * @dev 返回累计铸币税,预算?
     * @return 预算
     */
    function getReserve() public view returns (uint256) {
        return accumulatedSeigniorage;
    }

    // oracle
    /**
     * @dev 返回Bond预言机中Cash价格
     * @return 价格
     */
    function getBondOraclePrice() public view returns (uint256) {
        // 通过Bond预言机取Cash价格
        return _getCashPrice(bondOracle);
    }

    /**
     * @dev 返回铸币税预言机中Cash价格
     * @return 价格
     */
    function getSeigniorageOraclePrice() public view returns (uint256) {
        // 通过铸币税预言机取Cash价格
        return _getCashPrice(seigniorageOracle);
    }

    /**
     * @dev 根据不同的场景选择不同的预言机进行喂价
     * @param oracle 预言机地址
     * @return 价格
     */
    function _getCashPrice(address oracle) internal view returns (uint256) {
        try IOracle(oracle).consult(cash, 1e18) returns (uint256 price) {
            return price;
        } catch {
            revert('Treasury: failed to consult cash price from the oracle');
        }
    }

    /* ========== GOVERNANCE ========== */

    /**
     * @dev 合约初始化
     */
    function initialize() public checkAdmin {
        // 确认合约未经初始化
        require(!initialized, 'Treasury: initialized');

        // burn all of it's balance
        // 销毁本合约所有持有的GOC
        IERC20Burnable(cash).burn(IERC20(cash).balanceOf(address(this)));

        // set accumulatedSeigniorage to it's balance
        // 设置累计储备量为本合约GOC数量的初始余额,即为0
        accumulatedSeigniorage = IERC20(cash).balanceOf(address(this));

        initialized = true;
        //触发合约初始化事件
        emit Initialized(msg.sender, block.number);
    }

    /**
     * @dev 更换Admin为target（本合约），仅现Admin有权更换
     */
    function migrate(address target) public onlyAdmin checkAdmin {
        require(!migrated, 'Treasury: migrated');

        // cash
        //更换GOC合约的Admin，Owner为target，并把原合约的GOC发送至target
        AdminRole(cash).addAdmin(target);
        AdminRole(cash).renounceAdmin();
        IERC20(cash).transfer(target, IERC20(cash).balanceOf(address(this)));

        // bond
        //更换GOB合约的Admin，Owner为target，并把原合约的GOB发送至target
        AdminRole(bond).addAdmin(target);
        AdminRole(bond).renounceAdmin();
        IERC20(bond).transfer(target, IERC20(bond).balanceOf(address(this)));

        // share
        //更换GOT合约的Admin，Owner为target，并把原合约的GOT发送至target
        AdminRole(share).addAdmin(target);
        AdminRole(share).renounceAdmin();
        IERC20(share).transfer(target, IERC20(share).balanceOf(address(this)));

        migrated = true;
        //触发所有权转移事件
        emit Migration(target);
    }

    /**
     * @dev 设置开发者基金地址
     */
    function setFund(address newFund) public onlyAdmin {
        //设置开发贡献者奖金池
        fund = newFund;
        //触发更换开发贡献者奖金池事件
        emit ContributionPoolChanged(msg.sender, newFund);
    }

    /**
     * @dev 设置开发者奖励比例
     */
    function setFundAllocationRate(uint256 rate) public onlyAdmin {
        //设置开发贡献者奖金比例
        fundAllocationRate = rate;
        //触发更换开发贡献者奖金比例事件
        emit ContributionPoolRateChanged(msg.sender, rate);
    }

    /* ========== MUTABLE FUNCTIONS ========== */

    /**
     * @dev 预言机更新GOC价格
     */
    function _updateCashPrice() internal {
        try IOracle(bondOracle).update() {} catch {}
        try IOracle(seigniorageOracle).update() {} catch {}
    }

    /**
     * @dev 当GOC价格低于1时，使用GOC购买GOB
     * @param amount 购买数额
     * @param targetPrice 目标价格,需要和当前的Cash价格一致
     */
    function buyBonds(uint256 amount, uint256 targetPrice)
        external
        onlyOneBlock // 同一区块只能调用一次合约
        checkMigration // 检查是否迁移
        checkStartTime // 检查开始时间
        checkAdmin // 检查铸币权限
    {
        require(amount > 0, 'Treasury: cannot purchase bonds with zero amount');

        //通过Bond预言机获取GOC价格
        uint256 cashPrice = _getCashPrice(bondOracle);
        //GOC价格必须等于目标价格
        require(cashPrice == targetPrice, 'Treasury: cash price moved');
        //需要GOC价格小于1
        require(
            cashPrice < cashPriceOne, // price < $1
            'Treasury: cashPrice not eligible for bond purchase'
        );
        // Bond价格 = Cash价格
        uint256 bondPrice = cashPrice;
        //销毁用户持有的amount数量的GOC
        IERC20Burnable(cash).burnFrom(msg.sender, amount);
        //铸造GOB: 销毁1GOC能换取(1/bondPrice)个GOB
        IERC20Burnable(bond).mint(msg.sender, amount.mul(1e18).div(bondPrice));
        //更新GOC价格
        _updateCashPrice();
        //触发购买GOB事件
        emit BoughtBonds(msg.sender, amount);
    }

    /**
     * @dev 当GOC价格大于1.05时，使用GOB换回GOC
     * @param amount 赎回数额
     * @param targetPrice 目标价格,需要和当前的Cash价格一致
     */
    function redeemBonds(uint256 amount, uint256 targetPrice)
        external
        onlyOneBlock // 同一区块只能调用一次合约
        checkMigration // 检查是否迁移
        checkStartTime // 检查开始时间
        checkAdmin // 检查铸币权限
    {
        require(amount > 0, 'Treasury: cannot redeem bonds with zero amount');

        //通过预言机获取GOC价格
        uint256 cashPrice = _getCashPrice(bondOracle);
        //GOC价格必须等于目标价格
        require(cashPrice == targetPrice, 'Treasury: cash price moved');
        // 确认GOC价格大于cashPriceCeiling，即1.05
        require(
            cashPrice > cashPriceCeiling, // price > $1.05
            'Treasury: cashPrice not eligible for bond purchase'
        );
        // 确认当前合约的GOC数量大于要赎回的GOB数量
        require(IERC20(cash).balanceOf(address(this)) >= amount, 'Treasury: treasury has no more budget');
        // GOC的累计储备量 = 累计储备量 - 最小值(累计储备量,要赎回的GOB数量),即1GOB换取1GOC
        accumulatedSeigniorage = accumulatedSeigniorage.sub(Math.min(accumulatedSeigniorage, amount));

        // 销毁用户持有的GOB
        IERC20Burnable(bond).burnFrom(msg.sender, amount);
        // 将当前合约的GOC发送给用户
        IERC20(cash).safeTransfer(msg.sender, amount);
        // 更新GOC价格
        _updateCashPrice();

        // 触发赎回GOB事件
        emit RedeemedBonds(msg.sender, amount);
    }

    /**
     * @dev 增发GOC，并分配GOC
     */
    function allocateSeigniorage() external onlyOneBlock checkMigration checkStartTime checkEpoch checkAdmin {
        //更新GOC价格
        _updateCashPrice();
        //通过预言机获取GOC价格
        uint256 cashPrice = _getCashPrice(seigniorageOracle);
        //判断当GOC价格小于等于cashPriceCeiling即1.05则返回，不增发GOC
        if (cashPrice <= cashPriceCeiling) {
            return; // just advance epoch instead revert
        }

        // circulating supply
        //流通的GOC数量 = GOC总供应量 - GOC累计储备量
        uint256 cashSupply = IERC20(cash).totalSupply().sub(accumulatedSeigniorage);
        //增发比例 = GOC价格 - 1 例:0.8
        uint256 percentage = cashPrice.sub(cashPriceOne);
        //新铸造的GOC数量 = 流通的GOC数量 * 增发比例
        uint256 seigniorage = cashSupply.mul(percentage).div(1e18);
        //新铸造GOC,并发送至本合约
        IERC20Burnable(cash).mint(address(this), seigniorage);

        // ======================== BIP-3
        // 开发者基金储备 = 新铸造的GOC数量 * fundAllocationRate / 100 = 新铸造的GOC数量 * 2%
        uint256 fundReserve = seigniorage.mul(fundAllocationRate).div(100);
        if (fundReserve > 0) {
            // 当前合约批准fund地址,开发者准备金数额
            IERC20(cash).safeApprove(fund, fundReserve);
            // 调用fund合约的存款方法存入开发者准备金
            ISimpleERCFund(fund).deposit(cash, fundReserve, 'Treasury: Seigniorage Allocation');
            //触发GOC已发放至开发贡献池事件
            emit ContributionPoolFunded(now, fundReserve);
        }
        //新铸造的GOC数量 = 新铸造的GOC数量 - 开发者基金储备
        seigniorage = seigniorage.sub(fundReserve);

        // ======================== BIP-4
        //新增国库储备 = min(新铸造的GOC数量, GOB总供应量-累计GOC储备量)
        //即新铸造的GOC要先预留给GOB，剩下的才能分配给Boardroom
        uint256 treasuryReserve = Math.min(seigniorage, IERC20(bond).totalSupply().sub(accumulatedSeigniorage));
        if (treasuryReserve > 0) {
            //累计GOC储备量 = 累计GOC储备量 + 新增国库储备量
            accumulatedSeigniorage = accumulatedSeigniorage.add(treasuryReserve);
            //触发已发放国库储备事件
            emit TreasuryFunded(now, treasuryReserve);
        }

        // boardroom
        //董事会GOC新增储备量 = 新铸造的GOC - 新增国库储备量
        uint256 boardroomReserve = seigniorage.sub(treasuryReserve);
        if (boardroomReserve > 0) {
            // 批准国库合约储备量数额
            IERC20(cash).safeApprove(boardroom, boardroomReserve);
            //调用Boardroom合约的allocateSeigniorage方法,将GOC存入董事会
            IBoardroom(boardroom).allocateSeigniorage(boardroomReserve);
            //触发已发放资金至董事会事件
            emit BoardroomFunded(now, boardroomReserve);
        }
    }

    // GOV
    event Initialized(address indexed executor, uint256 at);
    event Migration(address indexed target);
    event ContributionPoolChanged(address indexed operator, address newFund);
    event ContributionPoolRateChanged(address indexed operator, uint256 newRate);

    // CORE
    event RedeemedBonds(address indexed from, uint256 amount);
    event BoughtBonds(address indexed from, uint256 amount);
    event TreasuryFunded(uint256 timestamp, uint256 seigniorage);
    event BoardroomFunded(uint256 timestamp, uint256 seigniorage);
    event ContributionPoolFunded(uint256 timestamp, uint256 seigniorage);
}

